pragma solidity ^0.5.0;

contract TrustMe {event __CoverageTrustMe(string fileName, uint256 lineNumber);
event __FunctionCoverageTrustMe(string fileName, uint256 fnId);
event __StatementCoverageTrustMe(string fileName, uint256 statementId);
event __BranchCoverageTrustMe(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageTrustMe(string fileName, uint256 branchId);
event __AssertPostCoverageTrustMe(string fileName, uint256 branchId);

  // TrustMe events
  event newProject(string name, string description, uint stakeToSell, uint projectValuation, uint finishCriteria);
  event investment(address investor, string projectName, uint amount, uint stakeBuyed);
  event projectWithdraw(string name, uint balance);
  // PROJECT STRUCTURE MODEL
  struct Project {
    string name;
    string description;
    string headerHash;
    uint stakeToSell;
    uint availableStake;
    uint projectValuation;
    uint finishCriteria;
    bool availableToInvest;
    address payable ownerAddress;
    uint balance;
    bool validProject;
  }
  mapping(address => uint[]) private projects; //projects storage
  Project[] private projectsStorage; //projects order by address
  // ask only for investor
  modifier onlyInvestor(uint projectIndex) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',1);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',26);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',1);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',1);
require(
      !contains(projectIndex,projects[msg.sender]),
      "The investor can't be the same person who published the project"
    );emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',1);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',30);
    _;
  }
  // ask only for investor
  modifier accomplishFinishCriteria(uint projectIndex) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',2);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',34);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',2);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',2);
require(
      projectsStorage[projectIndex].balance >= ((projectsStorage[projectIndex].stakeToSell * projectsStorage[projectIndex].finishCriteria) / 100),
      "The project does not accomplish the finish criteria"
    );emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',2);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',38);
    _;
  }
  // ask if the project is available to invest
  modifier availableToBuy(uint projectIndex){emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',3);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',42);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',3);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',3);
require(
      projectsStorage[projectIndex].availableToInvest,
      "This project is stopped by his owner"
    );emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',3);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',46);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',4);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',4);
require(
      projectsStorage[projectIndex].availableStake <= msg.value,
      "You can't buy a higher value than available"
    );emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',4);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',50);
    _;
  }
  // ask if the project has founds
  modifier withFounds(uint projectIndex){emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',4);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',54);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',5);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',5);
require(projectsStorage[projectIndex].balance != 0, 'You have no founds in that project');emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',5);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',55);
    _;
  }
  // ask if msg address has project
  modifier entrepeurWithProjects(uint projectIndex){emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',5);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',59);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',6);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',6);
require(contains(projectIndex,projects[msg.sender]),'This Project does not belongs to you!');emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',6);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',60);
    emit __AssertPreCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',7);
emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',7);
require(projectsStorage[projectIndex].validProject,'This Project does not exist');emit __AssertPostCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',7);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',61);
    _;
  }
  // check if elements exists in array
  function contains(
    uint element,
    uint[] memory arrayToSearch
  ) private      returns(bool success) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',6);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',68);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',8);
for(uint i = 0; i<arrayToSearch.length; i++) {
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',69);
      emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',9);
if(arrayToSearch[i] == element){emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',10);
emit __BranchCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',8,0);return true;}else { emit __BranchCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',8,1);}

    }
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',71);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',11);
return false;
  }
  // adding a new project
  function addProject (
    string memory name,
    string memory description,
    uint stakeToSell,
    uint projectValuation,
    uint finishCriteria,
    string memory headerHash
  ) public returns(
    string memory message
  ){emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',7);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',84);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',12);
projects[msg.sender].push(projectsStorage.length);
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',85);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',13);
projectsStorage.push(
      Project({
        name: name,
        description: description,
        stakeToSell: stakeToSell,
        availableStake: stakeToSell,
        projectValuation: projectValuation,
        finishCriteria: finishCriteria,
        headerHash: headerHash,
        availableToInvest: true,
        ownerAddress: msg.sender,
        balance: 0,
        validProject: true
      })
    );
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',100);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',14);
emit newProject(name, description, stakeToSell, projectValuation, finishCriteria);
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',101);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',15);
return("Successfully Added Project");
  }
  // get all projects count
  function getProjectsCount() public      returns (uint){emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',8);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',105);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',16);
return projectsStorage.length;
  }
  // get all address projects count
  function getAddressProjectsIndexes () public      returns (
    uint[] memory
  ) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',9);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',111);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',17);
return projects[msg.sender];
  }
  // get specific project
  function getProject (
    uint projectIndex
  ) public      returns (
    string memory name,
    string memory headerHash,
    string memory description,
    uint stakeToSell,
    uint availableStake,
    uint projectValuation,
    uint finishCriteria,
    bool availableToInvest,
    address owner,
    uint projectBalance
  ) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',10);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',128);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',18);
Project memory projectToReturn = projectsStorage[projectIndex];
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',129);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',19);
return (
      projectToReturn.name,
      projectToReturn.headerHash,
      projectToReturn.description,
      projectToReturn.stakeToSell,
      projectToReturn.availableStake,
      projectToReturn.projectValuation,
      projectToReturn.finishCriteria,
      projectToReturn.availableToInvest,
      projectToReturn.ownerAddress,
      projectToReturn.balance
    );
  }
  // invest in project
  function investInProject(
    uint projectIndex,
    uint projectStakeVal
  ) public onlyInvestor(projectIndex) availableToBuy(projectIndex) payable {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',11);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',147);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',20);
projectsStorage[projectIndex].availableStake -= projectStakeVal;
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',148);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',21);
projectsStorage[projectIndex].balance += msg.value;
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',149);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',22);
emit investment(msg.sender, projectsStorage[projectIndex].name, msg.value, projectStakeVal);
  }
  // stop project investment round
  function stopProjectInvestmentRound(
    uint projectIndex
  ) public entrepeurWithProjects(projectIndex) accomplishFinishCriteria(projectIndex) returns (
    string memory message,
    bool success
  ) {emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',12);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',158);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',23);
if (projectsStorage[projectIndex].availableToInvest) {emit __BranchCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',9,0);
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',159);
      emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',24);
projectsStorage[projectIndex].availableToInvest = false;
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',160);
      emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',25);
return ('Project successfully Stopped', true);
    } else {emit __BranchCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',9,1);
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',162);
      emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',26);
return ('Project already Stopped', false);
    }
  }
  // withdraw project balance
  function withdrawProjectBalance(
    uint projectIndex
  ) public withFounds(projectIndex) accomplishFinishCriteria(projectIndex) entrepeurWithProjects(projectIndex) payable{emit __FunctionCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',13);

emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',169);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',27);
Project memory projectToWithdraw = projectsStorage[projectIndex];
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',170);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',28);
projectToWithdraw.ownerAddress.transfer(projectToWithdraw.balance);
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',171);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',29);
projectToWithdraw.balance = 0;
emit __CoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',172);
    emit __StatementCoverageTrustMe('/mnt/c/Users/OXOFT/Documents/CURSOS/TrustMe/contracts/TrustMe.sol',30);
emit projectWithdraw(projectToWithdraw.name, projectToWithdraw.balance);
  }
}
